import useRenderCount from "../hooks/useRenderCount";

export interface BoxSelfDrivenRef {
  triggerIncrement: () => void;
}

export interface BoxSelfDrivenProps {
  ref?: Ref<BoxSelfDrivenRef>;
  increase?: () => void;
}

// React 19: ref is now a regular prop, no forwardRef needed
const BoxSelfDriven: React.FC<BoxSelfDrivenProps> = ({ increase, ref }) => {
  const [count, setCount] = useState(0);  // Each box owns its own state
  const RenderCount = useRenderCount();

  const increaseSelf = useCallback(() => {
    setCount((count) => count + 1);
  }, []);

  // Expose increment method to parent via ref (escape hatch pattern)
  useImperativeHandle(ref, () => ({
    triggerIncrement: increaseSelf,
  }));

  return (
    <div className="box" onClick={increaseSelf}>
      {increase && <button onClick={increase}>Increase</button>}
      <p>Render Count: {RenderCount}</p>
      <p>Click Count: {count}</p>
    </div>
  );
};

export default memo(BoxSelfDriven);  // memo works well here - no props change`}],Dh=[{title:"Page Component",fileName:"pages/parent-driven.tsx",code:`import { useCallback, useState } from "react";
